import React from 'react'

const Challenge = () => {
    const date = new Date();
    console.log(date)
    return (
        <div>
            <p>today's date is:{date.toLocaleString()}</p>
            <p>time is:{date.toLocale} </p>
        </div>
    )
}

export default Challenge;
